import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";

import { Rasp } from "../components/Rasp/index";
import { Time } from "../components/Time";
import { Predmet } from "../components/Predmet";

import { fetchRasps } from "../redux/slices/rasps";
import { fetchTimes } from "../redux/slices/times";
import {fetchPredmets} from "../redux/slices/predmets"
import { Group } from "@mui/icons-material";
import { fetchGroups } from "../redux/slices/group";


export const Home = () => {
  const dispatch = useDispatch();
  const userData = useSelector((state) => state.auth.data);
  const { rasps } = useSelector((state) => state.rasps);
  const { times } = useSelector((state) => state.times);
  const { predmets } = useSelector((state)  => state.predmets );
  const { groups } = useSelector((state) => state.groups);

  const [selectedTab, setSelectedTab] = useState(0); // Durum değişikliği

  useEffect(() => {
    dispatch(fetchRasps());
    dispatch(fetchTimes());
    dispatch(fetchPredmets());
    dispatch(fetchGroups());
  }, []);

  // Rasps ve times yüklenene kadar bekleyen loading state
  const isRaspsLoading = rasps.status === "loading";
  const isTimesLoading = times.status === "loading";
  const isPredmetsLoading = predmets.status === "loading";
  const isGroupsLoading = groups.status === "loading";


  const handleTabChange = (event, newValue) => {
    setSelectedTab(newValue);
  };

  console.log(groups);
  return (
    <>
      <Tabs
        style={{ marginBottom: 15 }}
        value={selectedTab}
        onChange={handleTabChange}
        aria-label="basic tabs example"
      >
        <Tab label="Расписания" />
        <Tab label="Время" />
        <Tab label="Предмет" />
        <Tab label="Deneme" />
      </Tabs>

      <div className="columns mt-5">
  <div>
    {selectedTab === 0 && (
      <table>
        <thead>
          <tr>
            <th>Time</th>
            <th>Day</th>
            <th>Predmed</th>
            <th>Group</th>
            <th>Teacher</th>
            <th>Kurs</th>
            <th>Room</th>
          </tr>
        </thead>
        <tbody>
          {isRaspsLoading ? (
            [...Array(50)].map((_, index) => (
              <Rasp key={index} isLoading={true} />
            ))
          ) : (
            rasps.items.map((obj) => (
              <Rasp
                key={obj._id}
                id={obj._id}
                time={obj.time.time}
                day={obj.day.day}
                predmet={obj.predmet.predmet}
                group={obj.group.group}
                teacher={obj.teacher.teacher}
                kurs={obj.group.kurs.kurs}
                room={obj.room}
                isEditable={userData?._id === obj.user._id}
              />
            ))
          )}
        </tbody>
      </table>
    )}
    {selectedTab === 1 && (
      <table>
        <thead>
          <tr>
            <th>Время</th>
            {selectedTab === 1 &&
            (isTimesLoading ? (
              <p>Loading...</p>
            ) : (
              times.items.map((time) => (
                <Time
                  key={time._id}
                  id={time._id}
                  time={time.time}
                  isEditable={userData?._id === time.user._id}
                />
              ))
            ))}
          </tr>
        </thead>
      </table>
    )}
    {selectedTab === 2 && (
      <table>
        <thead>
          <tr>
            <th>Предмет</th>
            {selectedTab === 2 &&
            (isPredmetsLoading ? (
              [...Array(50)].map((_, index) => (
                <Rasp key={index} isLoading={true} />
              ))
            ) : (
              predmets.items.map((predmet) => (
                <Predmet
                  key={predmet._id}
                  id={predmet._id}
                  predmet={predmet.predmet}
                  isEditable={userData?._id === predmet.user._id}
                />
              ))
            ))}
          </tr>
        </thead>
      </table>
    )}    
    {selectedTab === 3 && (
      <table>
        <thead>
          <tr>
            <th>Группа</th>
            {selectedTab === 1 &&
            (isGroupsLoading ? (
              <p>Loading...</p>
            ) : (
              groups.items.map((group) => (
                <Group
                  key={group._id}
                  id={group._id}
                  group={group.group}
                  kurs={group.kurs}
                  isEditable={userData?._id === group.user._id}
                />
              ))
            ))}
          </tr>
        </thead>
      </table>
    )}
  </div>
</div>

</>
  );
};
